import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";
import { Tablet } from "../Responsive";

const Wrapper = styled.footer`
  background-color: black;
  padding: 0;
  margin: 0;
  color: white;

  .footer {
    width: 100vw;
    display: flex;
    padding: 20px;
    flex-wrap: wrap;
  }

  .footer .item {
    flex: 100%;
    ${Tablet({ flex: "25%" })}
  }
  .footer .item h3 {
    color: rgba(30, 51, 187, 1);
  }
  .rule {
    border: 4px solid white;
  }
  .copywite {
    text-align: center;
    padding-bottom: 20px;
  }
  img {
    width: 30px;
    height: 30px;
  }
  .brand {
    align-self: flex-start;
  }
  .icon-header {
    display: flex;
  }
  .icon {
    margin-right: 20px;
  }
  .mobile-img {
    height: 30px;
    width: 90px;
    border-radius: 5px;
  }
  .mobile-container p {
    margin-bottom: 10px;
  }
`;

function Footer() {
  return (
    <Wrapper>
      <div className="footer">
        <div className="item">
          <div className="icon-header">
            <img src="/assets/brand.png" alt="brand" />{" "}
            <h3 className="ms-2">Bways</h3>
          </div>
        </div>
        <div className="item">
          <h3>RESOURCES</h3>
          <p>Blog</p>
          <p>Online training</p>
          <p>Qaulity for government contact</p>
          <p>National resource Guide</p>
        </div>
        <div className="item">
          <h3>OUR COMPNY</h3>
          <p>Contact us</p>
          <p>Privacy policy</p>
          <p>User agreement</p>
          <p>Privacy</p>
        </div>
        <div className="item brand">
          <h4>Follow Us</h4>
          <div className="icons-container">
            <i className="fa-brands fa-facebook icon"></i>
            <i className="fa-brands fa-twitter icon"></i>
            <i className="fa-brands fa-instagram icon"></i>
          </div>
          <div className="mobile-container mt-4">
            <p>Mobile</p>
            <div className="mobile">
              <Link to="/" className="me-3">
                <img
                  src="/assets/apple.jpg"
                  className="mobile-img"
                  alt="mobile"
                />
              </Link>
              <Link to="/">
                <img
                  src="/assets/google.jpg"
                  className="mobile-img"
                  alt="mobile"
                />
              </Link>
            </div>
          </div>
        </div>
      </div>
      <hr className="rule" />
      <p className="copywite">All Right reversed &copy; Bways 2023 </p>
    </Wrapper>
  );
}

export default Footer;
